  render() {

    return (
      <div>
        <Navbar filteredCities={this.props.filteredCities} searchCity={this.props.searchCity} continent={this.props.continent}  filterContinent={this.props.filterContinent} />    
           <Image  Images={this.props.citiesInfo}/> ;
      </div>
    );
  }
}
